import michellePic from "./michelle-obama.jpg";
import corgiPic from "./corgi.jpg";
import barackPic from "./barack-obama.jpg";

const data = {
  activeId: 0,
  user: {
    user_id: 0,
    name: "Corgi",
    pic: corgiPic,
    status: "First Lady",
  },
  messages: [
    {
      1: [
        {
          is_user: false,
          text: "Hello Corgi",
        },
        {
          is_user: true,
          text: "Hello Michelle!",
        },
      ],
    },
    {
      2: [
        {
          is_user: false,
          text: "Hi Corgi",
        },
        {
          is_user: false,
          text: "Hi Mr. President!",
        },
      ],
    },
  ],
  contacts: [
    {
      user_id: 1,
      name: "Michelle Obama",
      pic: michellePic,
      status: "First Lady",
    },
    {
      user_id: 2,
      name: "Barack Obama",
      pic: barackPic,
      status: "US President",
    },
  ],
};

export default data;
